/* eslint-disable react/jsx-pascal-case */
import React from 'react';
import './Navegacion.css'
import { Link, useNavigate } from "react-router-dom";



export default function Navegacion() {

    const nav_inicio = useNavigate();
    const Inicio = () => {
        nav_inicio("/Inicio");
    };

    const nav_sistema = useNavigate();
    const Sistema = () => {
        nav_sistema("/Sistema");
    };

    const nav_archivos = useNavigate();
    const Archivos = () => {
        nav_archivos("/archivos");
    };


    return (
        <>
            <div>
                <header id="headermenu">
                    <header id="titulos">
                        <div id="circulos"><div id="circulo"> </div><div id="circulo"> </div><div id="circulo"> </div></div>
                        <text id="texto_titulo">FUNDACIÓN MIA CONSTRUYENDO FUTURO</text>
                        <div></div>
                    </header>
                    <br />
                    <div id="div_horas">
                        <div />
                        <div />
                        <div id="div_hora" >
                            <input id="fecha" type="date" value="2022-02-07"></input>
                            <img id="dimagen" src="/img/icono_usuario.png" alt="" />
                            <text id="texto_admin" >Admin</text>
                        </div>
                    </div>
                    <br />
                    <footer id="foter">
                        <ul>
                            <li><Link to="/Inicio"> Inicio</Link></li>
                        </ul>
                        <ul>
                            <li>Ayuda</li>
                            <ul><li><Link to="/Sistema"> Sistema</Link></li></ul>
                            <ul><li><Link to="/Archivos"> Archivos</Link></li></ul>
                        </ul>
                        <ul>
                            <li>Administrador</li>
                            <ul><li><Link to="/Cambiar_Clave">Cambiar_Clave</Link></li></ul>
                            <ul><li><Link to="/Cargar_Datos">Cargar_Datos</Link></li></ul>
                            <ul><li><Link to="/Permisos_Privilegios">Permisos_Privilegios</Link></li></ul>
                            <ul><li><Link to="/Roles">Roles</Link></li></ul>
                        </ul>
                        <ul>
                            <li>Instituciones</li>
                            <ul><li><Link to="/Instituciones">Instituciones</Link></li></ul>
                        </ul>
                        <ul>
                            <li>Estudiantes</li>
                            <ul><li><Link to="/Buscar_Estudiante">Estudiantes</Link></li></ul>
                        </ul>


                       {/*<select id="select" class="selectpicker" aria-label="Default select example">
                            <option selected disabled>Administrador</option>
                            <option value="1">Cambiar Clave</option>
                            <option value="2">Cargar Datos</option>
                            <option value="3">Permisos y Privilegios</option>
                            <option value="4">Roles</option>
                            <option value="5">Usuarios</option>
                            <option value="5">Cargue Huella Estudiante Nuevo</option>
                        </select>*/}
                    </footer>
                </header>
            </div>
        </>
    )
}
